import React from 'react';
import './App.css';
import LabelBottomNavigation from './Components/BottomNavigation'
import {BrowserRouter, Route} from 'react-router-dom'
import About from './Components/About'

function App() {
  return (

    <BrowserRouter>
      <Route path="/" component={About} />
    </BrowserRouter>


  );
}

export default App;
